import React, {Component} from 'react';
import {ListItem,ListInfo} from '../style';
class List extends Component {
    render(){
        return (
            <div>
                <ListItem>
                    <img className="pic" src="https://upload-images.jianshu.io/upload_images/10472974-184bbe1cd4d6ea1b.jpeg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                    <ListInfo>
                        <h3 className="title">请记住杨绛先生的这4句话（深度文字）</h3>
                        <p className="desc">人的一生是一场漫长而坎坷的旅程，多去汲取别人人生的经验，我们在路途上就能少走些弯路，受益终生。 杨绛先生的这4句话，字字都是珠玑，读懂了它们，就...</p>
                    </ListInfo>
                </ListItem>
            </div>
        )
    }
}

export default List;
